
import 'dart:convert';

import 'package:connect2bahmni/domain/models/omrs_concept.dart';
import 'package:connect2bahmni/domain/models/form_definition.dart';
import 'package:flutter_test/flutter_test.dart';

void main() {
  test('Should Deserialize form defition', () {
    var def = jsonDecode(formDefinition);
    expect(def['name'], 'Form Template 1');
    expect(def['uuid'], "59c18ca8-1ae7-4d50-abfb-c0116cb9fb22");

    var formDef = FormDefinition.fromJson(def);
    expect(formDef.name, 'Form Template 1');
    expect(formDef.controls!.length, 12);
    expect(formDef.controls!.first.type, 'label');
    expect(formDef.controls!.first.controls, null);
    expect(formDef.controls!.first.properties?.location?.column, 0);
    expect(formDef.controls!.first.properties?.location?.column, 0);
    expect(formDef.controls![1].properties?.location?.row, 1);
    expect(formDef.controls![1].properties?.location?.column, 0);
    expect(formDef.controls!.first.properties?.mandatory, null);

    expect(formDef.controls![1].type, 'obsControl');
    expect(formDef.controls![1].properties?.mandatory, true);
    expect(formDef.controls![1].concept?.name, 'Height (cm)');
  });

  test('should deserialize form resource', () {
    var formResource = FormResource.fromJson(formResourceDefinition);
    expect(formResource.name, 'Form Template 3');
    var definition = formResource.definition;
    expect(definition?.name, 'Form Template 3');
    var second = formResource.definition;
    expect(second, definition);
  });

  test('should identify dataType', () {
    expect(ConceptDataType.values.asNameMap().containsKey('N/A'), false);
    expect(ConceptDataType.values.asNameMap().containsKey('na'), true);
  });

  test('should deserialize list of forms with privileges', () {
    var list = formDefList.map((e) => FormResource.fromJson(e)).toList();
    expect(list.length, 2);
    expect(list.first.privileges?.length, 2);
    expect(list[1].privileges, []);
  });
}



